{"query":"query NotableContributions {
  user(login: "jayvdb") {
    repositoriesContributedTo( first: 100, contributionTypes: [COMMIT], orderBy: { field: STARGAZERS, direction: DESC }) {
      edges {
        cursor
        node {
          isInOrganization
          owner {
            login
            avatarUrl
          }
          nameWithOwner
          watchers {
            totalCount
          }
          forks {
            totalCount
          }
          stargazers {
            totalCount
          }
          issues {
            totalCount
          }
          pullRequests {
            totalCount
          }
        }
      }
    }
  }
}
"}
